import React from 'react';

function Footer(props) {
    return (
        <div className="footer">
            <div className="container">
                <div className="row">
                        <h4>NASA</h4>
                        <h4>NASA API</h4>
                        <h4>LINKEDIN</h4>
                </div>
            </div>
        </div>
    );
}

export default Footer
